import React from 'react';
import { Link } from 'react-router-dom';

export default function Profile() {
  return (
    <div className="profile-container">
      <header>
        <img src="" alt=""/>
        <span>Bem Vinda, ong</span>

        <Link to="">
          Cadastrar novo caso
        </Link>
      </header>
    </div>
  )
}
